import React from 'react';

const Projects = () => {
  return (
    <section id="projects" className="projects-section">
      <h2 className="projects-heading">Projects</h2>
      <div className="projects-container">
        {/* Agro Connect Card */}
        <div className="project-card agro">
          <h3>Agro Connect</h3>
          <p>Designed a contract-based platform connecting farmers with bulk buyers, reducing market 
price fluctuations and ensuring fair trade for both parties. 
 Developed using Flutter for cross-platform mobile development, enabling a smooth and 
responsive user experience. </p>
        </div>

        {/* Campus Connect Card */}
        <div className="project-card campus">
          <h3>Campus Connect</h3>
          <p></p>
        </div>
      </div>
    </section>
  );
};

export default Projects;
